(1, 1, 'The Dust Will Never Settle Down by Shaykh Anwar al-Awlaki', 'uploads/2XjVsK6bfIPfHtLdGZkEaJ6ZLNdr3Hf8XUB6QLa8.jpg', '2021-02-15 09:45:39', '2021-02-15 09:45:39'),
(2, 1, 'Martin Luther King, Jr.  I Have a Dream  delivered 28 August 1963, at the Lincoln Memorial, Washington D.C.', 'uploads/ce8XHx3KQlFenVD2x3brASZ823mNnXMs4DYAxBWY.jpg', '2021-02-15 09:48:27', '2021-02-15 09:48:27'),
(3, 1, 'The Real Meaning of Ich Bin ein Berliner In West Berlin in 1963, President Kennedy delivered his most eloquent speech on the world stage. The director of the John F. Kennedy Presidential Library and Museum tells the evocative story behind JFK’s words.', 'uploads/tXbr2jiQ1XNYq2Q97Thb1PN1KVitfHT4ZmRwpGL2.jpg', '2021-02-15 09:54:32', '2021-02-15 09:54:32'),
(4, 1, 'See Nelson Mandela\'s \'I Am Prepared To Die\' Speech, Which Put Him In Prison For 27 Years', 'uploads/BLuB4ARukF0XjO7ECeInHF5xdZKZHzmueivNwAnu.jpg', '2021-02-15 09:56:07', '2021-02-15 09:56:07'),
(5, 1, 'Theodore Roosevelt, “Duties of American Citizenship”', 'uploads/YP7UOV0m49gIRyeLEBKru00AozCIfK0UJbYVSWv5.jpg', '2021-02-15 09:57:49', '2021-02-15 09:57:49'),
(6, 2, 'A constitution is the arrangement of magistrates in a state.', 'uploads/bNs9HYEhniUbX8473cBjxQlv5FxSfcwBQtCwIltw.jpg', '2021-02-15 10:05:28', '2021-02-15 10:05:28'),
(7, 2, 'All human actions have one or more of these seven causes: chance, nature, compulsions, habit, reason, passion, desire.', 'uploads/4RXG57Q03BO8ISRmOu3SA39O8YrWQWSPdF2bCJKj.jpg', '2021-02-15 10:10:23', '2021-02-15 10:10:23'),
(8, 3, '‘To be, or not to be: that is the question’ (Hamlet, Act 3, Scene 1)', 'uploads/zsvgVHu2Ui4dknPJ1rU31DmC79J0at0e6FXmA4NV.jpg', '2021-02-15 10:19:50', '2021-02-15 10:19:50');
